function StoreFilter(props){

    const {items} = props;

    const typeSet = new Set();
    const types = [];

    const allItems = items.map(function(newItem){
        return(typeSet.add(newItem.type))
    })

    for(let x of typeSet)
        types.push(x);

    const allTypes = types.map(function(newItem){
        return(
            <div classList = 'type'>
                <h2>{newItem.type}</h2>
            </div>
        )
    })

    return (

        <div classList = 'storeFilter'>
            {allTypes}
        </div>

    )
}

export {StoreFilter}
